  deriving (Eq,Show,Ord)

printPosn :: Posn -> String
printPosn (Pn _ l c) = "line " ++ show l ++ ", column " ++ show c

tokenPos :: [Token] -> String
tokenPos (t:_) = printPosn (tokenPosn t)
tokenPos [] = "end of file"

tokenPosn :: Token -> Posn
tokenPosn (PT p _) = p
tokenPosn (Err p) = p

tokenLineCol :: Token -> (Int, Int)
tokenLineCol = posLineCol . tokenPosn

posLineCol :: Posn -> (Int, Int)
posLineCol (Pn _ l c) = (l,c)

mkPosToken :: Token -> ((Int, Int), Data.Text.Text)
mkPosToken t@(PT p _) = (posLineCol p, tokenText t)

tokenText :: Token -> Data.Text.Text
tokenText t = case t of
  PT _ (TS s _) -> s
  PT _ (TL s)   -> Data.Text.pack (show s)
  PT _ (TI s)   -> s
  PT _ (TV s)   -> s
  PT _ (TD s)   -> s
  PT _ (TC s)   -> s
  Err _         -> Data.Text.pack "#error"

prToken :: Token -> String
prToken t = Data.Text.unpack (tokenText t)

data BTree = N | B Data.Text.Text Tok BTree BTree deriving (Show)

eitherResIdent :: (Data.Text.Text -> Tok) -> Data.Text.Text -> Tok
eitherResIdent tv s = treeFind resWords
  where
  treeFind N = tv s
  treeFind (B a t left right) | s < a  = treeFind left
                              | s > a  = treeFind right
                              | s == a = t

resWords :: BTree
resWords = b "HOPPING" 32 (b "AND" 16 (b ":" 8 (b "+" 4 (b ")" 2 (b "(" 1 N N) (b "*" 3 N N)) (b "-" 6 (b "," 5 N N) (b "." 7 N N))) (b "<>" 12 (b "<" 10 (b ";" 9 N N) (b "<=" 11 N N)) (b ">" 14 (b "=" 13 N N) (b ">=" 15 N N)))) (b "CROSS" 24 (b "BY" 20 (b "AVG" 18 (b "AS" 17 N N) (b "BETWEEN" 19 N N)) (b "COUNT(*)" 22 (b "COUNT" 21 N N) (b "CREATE" 23 N N))) (b "FROM" 28 (b "DAY" 26 (b "DATE" 25 N N) (b "FORMAT" 27 N N)) (b "GROUP" 30 (b "FULL" 29 N N) (b "HAVING" 31 N N))))) (b "SESSION" 48 (b "MINUTE" 40 (b "JOIN" 36 (b "INTERVAL" 34 (b "INSERT" 33 N N) (b "INTO" 35 N N)) (b "MAX" 38 (b "LEFT" 37 N N) (b "MIN" 39 N N))) (b "OR" 44 (b "NOT" 42 (b "MONTH" 41 N N) (b "ON" 43 N N)) (b "SECOND" 46 (b "RIGHT" 45 N N) (b "SELECT" 47 N N)))) (b "WHERE" 56 (b "TOPIC" 52 (b "SUM" 50 (b "STREAM" 49 N N) (b "TIME" 51 N N)) (b "VALUES" 54 (b "TUMBLING" 53 N N) (b "WEEK" 55 N N))) (b "[" 60 (b "WITHIN" 58 (b "WITH" 57 N N) (b "YEAR" 59 N N)) (b "{" 62 (b "]" 61 N N) (b "}" 63 N N)))))
   where b s n = let bs = Data.Text.pack s
                 in  B bs (TS bs n)

unescapeInitTail :: Data.Text.Text -> Data.Text.Text
unescapeInitTail = Data.Text.pack . unesc . tail . Data.Text.unpack
  where
  unesc s = case s of
    '\\':c:cs | elem c ['\"', '\\', '\''] -> c : unesc cs
    '\\':'n':cs  -> '\n' : unesc cs
    '\\':'t':cs  -> '\t' : unesc cs
    '\\':'r':cs  -> '\r' : unesc cs
    '\\':'f':cs  -> '\f' : unesc cs
    '"':[]    -> []
    c:cs      -> c : unesc cs
    _         -> []

